exports=async function(bid,options){const{parseCatalogPaginate,selectIndexTotalPagesRegex}=await require("transcode/parse_catalog"),clientOptions={...(options&&options.clientOptions)};return parseCatalogPaginate(page=>`https://www.bxwx.la/b/${bid.idPrefix()}/${bid}/${1===page?"":"index_"+page+".html"}`,".section-list",{...options,clientOptions,pageSize:20,totalPagesRegex:selectIndexTotalPagesRegex})};